ipxact:field.ipxact:description:
Swap dp and dn lines. Applies to low power mode. This field is quasi-static. 
 - 1'b0: positive on dp / negative on dn;
 - 1'b1: positive on dn / negative on dp;

Swap dp and dn lines. Applies to high speed mode. This field is quasi-static. 
 - 1'b0: positive on dp / negative on dn;
 - 1'b1: positive on dn / negative on dp;

Bus with status information of the deskew algorithm. 
 - [0] - signals that the deskew algorithm has finished;
 - [1] - signals that an initial calibration has finished successfully;
 - [2] - signals that an initial calibration has finished with an unsatisfactory eye size;
 - [3] - signals that an initial calibration has failed;
 - [4] - signals that a fine calibration has finished with convergence;
 - [5] - signals that a fine calibration ran out of time but found a new best setting;
 - [6] - signals that a fine calibration ran out of time with no best setting;
 - [7] - signals that during either calibration the phase setting went out of bounds.

Swap dp and dn lines. Applies to high speed mode. This field is quasi-static. 
 - 1'b0: positive on dp / negative on dn;
 - 1'b1: positive on dn / negative on dp;

